import "./App.css";
import Navbar from "./components/navbar/Navbar";
import compu from "./assets/img/compu.png";

function App() {
  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <div>
          <h1>El impulso que hace crecer tu marca</h1>
        </div>
        <div>
          <img src={compu} alt="Hero" />
        </div>
      </main>
    </div>
  );
}

export default App;
